import React from 'react';
import classes from './MenuStructure.module.css';
import {NavLink} from 'react-router-dom';
const MenuStructure =(props)=>{
    let styleOuterList = null;
    let styleMenuStructure = null;
    let styleOuterListItem = null;
    let styleInnerList = null;
    let menu = null;
    if(props.show){
        styleOuterList = classes.OuterListToggled;
        styleMenuStructure = classes.MenuStructureToggled;
        styleOuterListItem= classes.OuterListItemToggled;
        styleInnerList = classes.InnerListToggled;
        menu = (<div className = {styleMenuStructure} onClick = {props.clicked} >
        <ul className = {styleOuterList} >
            <li className = {styleOuterListItem}><i className="mdi mdi-speedometer mr-1"></i>Dashboards<span className = "mdi mdi-chevron-down"></span>
                <ul className = {styleInnerList}>
                    <li><a href="/">Ecommerse</a></li>
                    <li><a href="/">CRM</a></li>
                </ul>
            </li>
            <li className = {styleOuterListItem}><i className="mdi mdi-buffer mr-1"></i>Даатгал<span className = "mdi mdi-chevron-down"></span>
                <ul className = {styleInnerList}>
                    <li><NavLink to = "/daatgal/vehicle">Тээврийн хэрэгсэл</NavLink></li>
                    <li><NavLink to = "/daatgal/gate">Гарц даатгал</NavLink></li>
                    <li><NavLink to = "/daatgal/apartment">Орон сууцны даатгал</NavLink></li>
                </ul>
            </li>

        </ul>
    </div>);
        console.log("props.show true");
    }else{
        styleOuterList = classes.OuterList;
        styleMenuStructure = classes.MenuStructure;
        styleOuterListItem= classes.OuterListItem;
        styleInnerList = classes.InnerList;
        
        console.log("props.show false");
    }

    
    return(
        <Auxi>
        {menu}
        <div className = {styleMenuStructure} onClick = {props.clicked} >
            <ul className = {styleOuterList} >
                <li className = {styleOuterListItem}><i className="mdi mdi-speedometer mr-1"></i>Dashboards<span className = "mdi mdi-chevron-down"></span>
                    <ul className = {styleInnerList}>
                        <li><a href="/">Ecommerse</a></li>
                        <li><a href="/">CRM</a></li>
                    </ul>
                </li>
                <li className = {styleOuterListItem}><i className="mdi mdi-buffer mr-1"></i>Даатгал<span className = "mdi mdi-chevron-down"></span>
                    <ul className = {styleInnerList}>
                        <li><NavLink to = "/daatgal/vehicle">Тээврийн хэрэгсэл</NavLink></li>
                        <li><NavLink to = "/daatgal/gate">Гарц даатгал</NavLink></li>
                        <li><NavLink to = "/daatgal/apartment">Орон сууцны даатгал</NavLink></li>
                    </ul>
                </li>
    
            </ul>
        </div>
        </Auxi>
    );
}
export default MenuStructure;
